def ok(n):
    s = str(n)
    if s[0] != s[-1]: return False
    r = s.rfind(min(s))
    first, last = list(s[:r]), list(s[r:])
    return first == sorted(first, reverse=True) and last == sorted(last)
print([k for k in range(1, 2223) if ok(k)]) # _Michael S. Branicky_, Feb 01 2026

